function Login({setValue}){
    return( 
        <div className="Main">
            <div className="textUserContent">
                <h2>Ingresar</h2>
            </div>
            <div className="userContent">
                <input className="input"></input>
            </div>
            <div className="passwordContent">
                <input className="InputPassword"></input>
            </div>
            <div className="createContent">
                <a className="CreteAccount" href="#" onClick={(e) => {
                    e.preventDefault();
                    setValue(0); // cambia a formulario de crear cuenta
                }}>Crear cuenta</a>
            </div>
            <div className="buttonContent">
                <button className="ButtonIn">Ingresar</button>
            </div>
        </div>
    );
}
export default Login;
